func Or(predicates ...predicate.ScheduleJob) predicate.ScheduleJob {
	return predicate.ScheduleJob(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ScheduleJob) predicate.ScheduleJob {
	return predicate.ScheduleJob(sql.NotPredicates(p))
}
